import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import {TextField} from '@material-ui/core';

function Login(){
    return (
        <>
            <TextField variant="outlined" label="E-mail" id="email" />
        </>
    );
}

export default Login;
